import React from 'react';
import './Login.css'

const Login = () => {
    return (
        <div className='form-container'>
            <h2 className='form-title'>Please Login!!!!</h2>
            <div className="input-grout">
                <label htmlFor='email'>Email</label>
                <input type="text" name="" id="" />
            </div>
        </div>
    );
};

export default Login;
